import React from "react";
import "./translate.scss";

class Translate extends React.Component {
    render() {
        return (
                <div class="single bounce-in-top">
                    <div class="word">
                        {this.props.location.name}
                    </div>
                    <div class="def">
                        {this.props.current.temp_c}
                    </div>
                </div>
        );
    }
}
export default Translate;
